import React from 'react';

const Rank = ({name}) => {
    return (
        <div className='ma4 mt0 white f3'>
                {`Bonjour ${name} ! Quelle image allons-nous scanner aujourd'hui ?`}
        </div>
    )
}

export default Intro;
